import logo from './logo.svg';
import './App.css';
import Menu from './components/Menu';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div className='menu'>
      <img src={logo} className="App-logo" alt="logo" />
        <Menu></Menu>
      </div>
      </header>
    </div>
  );
}

export default App;
